import React, { useState } from 'react';
import { motion } from 'framer-motion';
import { useTheme } from '../App';
import { BarChart3, TrendingUp, Users, Eye, Share2, Clock, Target, Zap } from 'lucide-react';

const Analytics = () => {
  const { colors } = useTheme();
  const [timeRange, setTimeRange] = useState('7d');

  const analyticsStyles = {
    container: {
      minHeight: '100vh',
      padding: '120px 2rem 2rem 2rem',
    },
    content: {
      maxWidth: '1400px',
      margin: '0 auto',
    },
    header: {
      textAlign: 'center',
      marginBottom: '4rem',
    },
    heading: {
      fontSize: '3rem',
      fontWeight: 'bold',
      color: colors.text,
      marginBottom: '1rem',
    },
    subheading: {
      fontSize: '1.25rem',
      color: colors.textSecondary,
      maxWidth: '600px',
      margin: '0 auto',
    },
    timeSelector: {
      display: 'flex',
      gap: '1rem',
      justifyContent: 'center',
      marginBottom: '3rem',
    },
    timeButton: {
      padding: '0.75rem 1.5rem',
      background: 'transparent',
      border: `1px solid ${colors.border}`,
      borderRadius: '12px',
      color: colors.text,
      cursor: 'pointer',
      transition: 'all 0.3s ease',
    },
    activeTimeButton: {
      background: colors.gradient,
      color: 'white',
      borderColor: 'transparent',
    },
    statsGrid: {
      display: 'grid',
      gridTemplateColumns: 'repeat(auto-fit, minmax(250px, 1fr))',
      gap: '2rem',
      marginBottom: '3rem',
    },
    statCard: {
      background: colors.cardGradient,
      padding: '2rem',
      borderRadius: '20px',
      border: `1px solid ${colors.border}`,
      textAlign: 'center',
      backdropFilter: 'blur(10px)',
    },
    statValue: {
      fontSize: '2.5rem',
      fontWeight: 'bold',
      background: colors.gradient,
      WebkitBackgroundClip: 'text',
      WebkitTextFillColor: 'transparent',
      backgroundClip: 'text',
      marginBottom: '0.5rem',
    },
    statLabel: {
      color: colors.textSecondary,
      fontSize: '1rem',
      fontWeight: '500',
    },
    chartsGrid: {
      display: 'grid',
      gridTemplateColumns: 'repeat(auto-fit, minmax(400px, 1fr))',
      gap: '2rem',
    },
    chartCard: {
      background: colors.surface,
      padding: '2rem',
      borderRadius: '20px',
      border: `1px solid ${colors.border}`,
    },
    chartHeader: {
      display: 'flex',
      justifyContent: 'space-between',
      alignItems: 'center',
      marginBottom: '2rem',
    },
    chartTitle: {
      color: colors.text,
      fontSize: '1.25rem',
      fontWeight: '600',
    },
    performanceGrid: {
      display: 'grid',
      gridTemplateColumns: 'repeat(auto-fit, minmax(300px, 1fr))',
      gap: '2rem',
      marginTop: '3rem',
    },
    performanceCard: {
      background: colors.cardGradient,
      padding: '2rem',
      borderRadius: '20px',
      border: `1px solid ${colors.border}`,
    },
  };

  const stats = [
    { icon: Eye, value: '24.5K', label: 'Content Views', change: '+12%' },
    { icon: Share2, value: '3.2K', label: 'Shares', change: '+8%' },
    { icon: Users, value: '15.7K', label: 'Engaged Users', change: '+15%' },
    { icon: Clock, value: '2.4min', label: 'Avg. Read Time', change: '+5%' },
  ];

  const performanceMetrics = [
    { metric: 'Content Quality Score', value: 94, target: 90 },
    { metric: 'Engagement Rate', value: 87, target: 85 },
    { metric: 'Conversion Rate', value: 12, target: 10 },
    { metric: 'SEO Score', value: 96, target: 95 },
  ];

  return (
    <motion.div
      initial={{ opacity: 0, y: 20 }}
      animate={{ opacity: 1, y: 0 }}
      exit={{ opacity: 0, y: -20 }}
      style={analyticsStyles.container}
    >
      <div style={analyticsStyles.content}>
        <div style={analyticsStyles.header}>
          <h1 style={analyticsStyles.heading}>
            Content <span style={{ background: colors.gradient, WebkitBackgroundClip: 'text', WebkitTextFillColor: 'transparent' }}>Analytics</span>
          </h1>
          <p style={analyticsStyles.subheading}>
            AI-powered insights and performance tracking for your content
          </p>
        </div>

        {/* Time Range Selector */}
        <div style={analyticsStyles.timeSelector}>
          {['24h', '7d', '30d', '90d'].map((range) => (
            <motion.button
              key={range}
              whileHover={{ scale: 1.05 }}
              whileTap={{ scale: 0.95 }}
              onClick={() => setTimeRange(range)}
              style={{
                ...analyticsStyles.timeButton,
                ...(timeRange === range && analyticsStyles.activeTimeButton),
              }}
            >
              {range}
            </motion.button>
          ))}
        </div>

        {/* Stats Grid */}
        <div style={analyticsStyles.statsGrid}>
          {stats.map((stat, index) => (
            <motion.div
              key={index}
              initial={{ opacity: 0, y: 20 }}
              animate={{ opacity: 1, y: 0 }}
              transition={{ delay: index * 0.1 }}
              whileHover={{ scale: 1.05, y: -5 }}
              style={analyticsStyles.statCard}
            >
              <stat.icon size={48} style={{ color: colors.primary, margin: '0 auto 1rem' }} />
              <div style={analyticsStyles.statValue}>{stat.value}</div>
              <div style={analyticsStyles.statLabel}>{stat.label}</div>
              <div style={{ color: '#10b981', fontSize: '0.9rem', fontWeight: '600', marginTop: '0.5rem' }}>
                {stat.change}
              </div>
            </motion.div>
          ))}
        </div>

        {/* Performance Metrics */}
        <div style={analyticsStyles.performanceGrid}>
          {performanceMetrics.map((metric, index) => (
            <motion.div
              key={index}
              initial={{ opacity: 0, x: -20 }}
              animate={{ opacity: 1, x: 0 }}
              transition={{ delay: index * 0.1 }}
              style={analyticsStyles.performanceCard}
            >
              <h3 style={{ color: colors.text, marginBottom: '1rem', fontSize: '1.1rem' }}>
                {metric.metric}
              </h3>
              <div style={{ display: 'flex', alignItems: 'center', gap: '1rem', marginBottom: '1rem' }}>
                <div style={{ flex: 1, background: colors.border, borderRadius: '10px', height: '8px' }}>
                  <div 
                    style={{ 
                      background: colors.gradient, 
                      height: '100%', 
                      borderRadius: '10px',
                      width: `${metric.value}%`
                    }} 
                  />
                </div>
                <span style={{ color: colors.text, fontWeight: '600', minWidth: '40px' }}>
                  {metric.value}%
                </span>
              </div>
              <div style={{ display: 'flex', justifyContent: 'space-between', color: colors.textSecondary, fontSize: '0.9rem' }}>
                <span>Current</span>
                <span>Target: {metric.target}%</span>
              </div>
            </motion.div>
          ))}
        </div>
      </div>
    </motion.div>
  );
};

export default Analytics;
